import React, { useState } from 'react';

export default function Index() {
    const [search, setSearch] = useState("");
    const [category, setCategory] = useState("");
    const allData = [
        {
            name: "iPhone 13",
            category: "Mobile",
            price: 79999,
            img: "data:image/jpeg;base64,",
        },
        {
            name: "Samsung Galaxy S21",
            category: "Mobile",
            price: 69999,
            img: "data:image/jpeg;base64,",
        },
        {
            name: "OnePlus 9 Pro",
            category: "Mobile",
            price: 64999,
            img: "data:image/jpeg;base64,",
        },
        {
            name: "Xiaomi Mi 11X",
            category: "Mobile",
            price: 29999,
            img: "data:image/jpeg;base64,",
        },
        {
            name: "Oppo Reno6",
            category: "Mobile",
            price: 38999,
            img: "data:image/jpeg;base64,",
        },
        {
            name: "Mahindra Thar ROXX",
            category: "Car",
            price: 1299999,
            img: "data:image/jpeg;base64,",
        },
        {
            name: "Maruti Suzuki Swift",
            category: "Car",
            price: 799999,
            img: "data:image/jpeg;base64,",
        },
        {
            name: "Hyundai Creta",
            category: "Car",
            price: 1059999,
            img: "data:image/jpeg;base64,",
        },
        {
            name: "Tata Nexon",
            category: "Car",
            price: 999999,
            img: "data:image/jpeg;base64,",
        },
        {
            name: "Kia Seltos",
            category: "Car",
            price: 1159999,
            img: "data:image/jpeg;base64,",
        },
        {
            name: "Levi's Denim Jacket",
            category: "Cloth",
            price: 3499,
            img: "data:image/jpeg;base64,",
        },
        {
            name: "Nike Sports T-shirt",
            category: "Cloth",
            price: 1999,
            img: "data:image/jpeg;base64,",
        },
        {
            name: "Adidas Running Shoes",
            category: "Cloth",
            price: 4999,
            img: "data:image/jpeg;base64,",
        },
        {
            name: "Zara Casual Shirt",
            category: "Cloth",
            price: 2599,
            img: "data:image/jpeg;base64,",
        },
        {
            name: "H&M Slim Fit Jeans",
            category: "Cloth",
            price: 2999,
            img: "data:image/jpeg;base64,",
        },
    ]

        
        const filteredData = allData.filter((item) => 
            (category === "" || item.category === category) && 
            item.name.includes(search)
        );
        

    return (
        <div className="container">
            <h1>Product List</h1>
            <div className="filter-section">
                <input id="search-input" type="text" className="search-bar" value={search} onChange={(e) => setSearch(e.target.value)} placeholder="Search"/>
                <select id="category-select" className="category-dropdown" value={category} onChange={(e) => setCategory(e.target.value)}>
                    <option value="">All Categories</option>
                    <option value="Mobile">Mobile</option>
                    <option value="Car">Car</option>
                    <option value="Cloth">Cloth</option>
                </select>
            </div>

            <div className="product-list">
                {
                    filteredData.map((e,i)=>{
                      return  <div key={i} className="product-item">
                            <img className="product-image" src={e.img}/>
                            <h3 className="product-name">{e.name}</h3>
                            <p className="product-price">Price: ₹{e.price}</p>
                    </div>
                    })
                }
            </div>
        </div>
    )
}
